### Ethereum Blockchain Messenger Smart Contract

Below is a Solidity smart contract that meets the specified requirements. This contract utilizes the `string` type for storing messages and `uint256` for counting updates.

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping of message IDs to their respective messages
    mapping (uint256 => string) public messages;

    // Mapping of message IDs to their update counts
    mapping (uint256 => uint256) public updateCounts;

    // Mapping of message IDs to their authors
    mapping (uint256 => address) public authors;

    // Counter for generating unique message IDs
    uint256 public messageIdCounter = 0;

    // Function to save a message on the blockchain
    function saveMessage(string memory _message) public {
        // Increment the message ID counter
        messageIdCounter++;

        // Store the message with the new ID
        messages[messageIdCounter] = _message;

        // Set the author of the message
        authors[messageIdCounter] = msg.sender;

        // Initialize the update count to 1
        updateCounts[messageIdCounter] = 1;
    }

    // Function to update a message on the blockchain
    function updateMessage(uint256 _id, string memory _newMessage) public {
        // Check if the message ID exists
        require(_id > 0 && messages[_id] != "", "Message ID does not exist.");

        // Check if the sender is the author of the message
        require(msg.sender == authors[_id], "Only the author can update the message.");

        // Update the message
        messages[_id] = _newMessage;

        // Increment the update count
        updateCounts[_id]++;
    }

    // Function to get a message from the blockchain
    function getMessage(uint256 _id) public view returns (string memory) {
        // Check if the message ID exists
        require(_id > 0 && messages[_id] != "", "Message ID does not exist.");

        // Return the message
        return messages[_id];
    }

    // Function to get the update count of a message
    function getUpdateCount(uint256 _id) public view returns (uint256) {
        // Check if the message ID exists
        require(_id > 0 && messages[_id] != "", "Message ID does not exist.");

        // Return the update count
        return updateCounts[_id];
    }
}
```

### Explanation

This contract includes the following key features:

1.  **Message Storage**: The contract uses a `mapping` to store messages with unique IDs. Each message is associated with its author and update count.
2.  **Message Saving**: The `saveMessage` function allows users to save messages on the blockchain. It generates a new ID, stores the message, sets the author, and initializes the update count.
3.  **Message Updating**: The `updateMessage` function enables authors to update their messages. It checks if the message ID exists and if the sender is the author before updating the message and incrementing the update count.
4.  **Message Retrieval**: The `getMessage` function allows users to retrieve messages by their IDs. It checks if the message ID exists before returning the message.
